import React from 'react'
import  { MaterialList }  from '../helpers/MaterialList'
import MaterialItem from '../components/MaterialItem'

function Materials() {
  return (
    <div className="materials">
        <h1 className="materialTitle">PUT MATERIALS HERE ASH!</h1>
        <div className="materialList">{MaterialList.map ((materialItem, key) => {
            return <div> {materialItem.name}</div>
              return ( 
              <MaterialItem
               key={key}
               image={materialItem.image} 
               name={materialItem.name}
                />
        )
        })}</div>
    </div>
  )
}

export default Materials
